import React, { Component } from 'react'
import image from '../images/de.jpg'

export default class Pages extends Component {
    constructor(props) {
        super(props);
        this.state = {
            image: "../images/de.jpg",
            isLoaded: false,
            items: []
        }
    }

    componentDidMount() {
        fetch('http://localhost:3000/pages')
          .then(res => res.json())
          .then(result => {
            this.setState({
              isLoaded: true,
              items: result
            });
          });
      }
    render() {
        return (
            <div>
                <img src='../images/de.jpg'></img>
                <div>{this.state.items}</div>
            </div>
        )
    }
}
